import { StyleSheet } from "react-native";

export default StyleSheet.create({
    body: {
        display: 'flex',
        alignItems: 'center',
        backgroundColor: '#fff',
        height: '100%',
    },
    header: {
        marginTop: 20,
        fontSize: 20,
        fontWeight: 'bold',
    },
    inputs:{
        marginTop: 50,
        marginBottom: 50,
    },
    input:{
        backgroundColor: '#bbb'
    }
})
